import React, { useState } from 'react';
import SearchBar from './components/searchBar'; // Adjust the path as necessary
import ImageDisplay from './components/ImageDisplay'; // Adjust the path as necessary
import { fetchImage } from './components/Script'; // Your API call function
import './Ap'


const App = () => {
  const [imageUrl, setImageUrl] = useState(null);
  const [error, setError] = useState(null);

  const handleSearch = async (searchTerm) => {
    try {
      setError(null); // Reset error state
      const url = await fetchImage(searchTerm);
      setImageUrl(url);
    } catch (err) {
      setError(err.message);
    }
  };
//uint256 hash ++ 
  return (
    <div>
      <h1>Search for Actress Image</h1>
      <SearchBar onSearch={handleSearch} />
      {error && <p>Error: {error}</p>}
      <ImageDisplay imageUrl={imageUrl} />
    </div>
  );
};

export default App;
